import logo from "./logo.svg";
import "./App.css";

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <div className="img_logo">
          <img src="https://catherineasquithgallery.com/uploads/posts/2021-03/1614604873_40-p-avatarki-na-belom-fone-49.png"></img>
        </div>
      </header>
      <nav className="nav">
        <div>
          <a>Profile</a></div>
        <div>
        <a>Messages</a>
        </div>
        <div>
        <a>News</a></div>
        <div>
        <a>Music</a></div>
        <div><a>Settings
          </a></div>
      </nav>
      <div className="content">
        <img src="https://sun9-39.userapi.com/impf/0WHZBC0ZDCeCJmuZ5ioxID8uluYBudUsldkc3A/3pYVY7lDemE.jpg?size=1590x530&quality=95&crop=1118,0,2242,747&sign=5acd1d3714234619a78a8f3a081630e8&type=cover_group"></img>Main content</div>
    </div>
  );
};

export default App;
